import { createRouter, createWebHistory } from 'vue-router';

import MainPage from '@/views/MainPage.vue'; // 실제 경로에 맞게 수정해야 합니다.
import LoginPage from '@/components/LoginPage.vue'; // 실제 경로에 맞게 수정해야 합니다.
import MatchingApplyDetailPage from '@/components/MatchingApplyDetailPage.vue'; // 실제 경로에 맞게 수정해야 합니다.
import MatchingApplyPage from '@/views/MatchingApplyPage.vue'; // 실제 경로에 맞게 수정해야 합니다.
import MyInfoPage from '@/views/MyInfoPage.vue'; // 실제 경로에 맞게 수정해야 합니다.
import MatchingBoardPage from '@/views/MatchingBoardPage.vue'; // 실제 경로에 맞게 수정해야 합니다.
import SignUpPage from '@/views/SignUpPage.vue'; // 실제 경로에 맞게 수정해야 합니다.
import MatchingBoardDetailPage from '@/views/MatchingBoardDetailPage.vue'; // 실제 경로에 맞게 수정해야 합니다.

const routes= [
    {
      path: '/MainPage',
      component: MainPage
    },
    {
      path: '/',
      component: LoginPage
    },
    {
      path: '/MatchingApplyDetailPage',
      component: MatchingApplyDetailPage
    },
    {
      path: '/MatchingApplyPage',
      component: MatchingApplyPage
    },
    {
      path: '/MyInfoPage',
      component: MyInfoPage
    },
    {
      path: '/MatchingBoardPage',
      component: MatchingBoardPage
    },
      {
        path: '/SignUpPage',
        component: SignUpPage
      },
      {
        path: '/MatchingBoardDetailPage',
        component: MatchingBoardDetailPage
      },
  
  ];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
